import streetphoto from "../images/exterior/street.jpg";

export default function Hero() {
  return (
    <div>
      <img src={streetphoto} />
      <div
        style={{
          position: "absolute",
          top: "50%",
          left: "50%",
          transform: "translate(-50%, -50%)",
          color: "white",
          fontSize: "24px",
          fontWeight: "bold",
          textShadow: "2px 2px 4px rgba(0, 0, 0, 0.8)",
        }}
      >
        Welcome to Nimbus.
      </div>
    </div>
  );
}
